webpackJsonp([258],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-spanish-terminology-alignment.json":function(n,a){n.exports={data:{markdownRemark:{html:'<p>Para evitar confusión para otros Campers necesitamos alinearnos todos los traductores con la misma terminología. Para ello, hemos creado una lista con las palabras más comúnes y las traducciones que hemos estado utilizando hasta ahora.</p>\n<p>Vale recalcar que todos los términos están abiertos a discusión. En caso se tenga que hacer algún cambio, nos pueden enviar un mensaje directo a través de Slack a <span class="mention">@miya</span> o <span class="mention">@eabedrapo</span>.</p>\n<h2>FCC terminology</h2>\n<h3>Untranslated</h3>\n<ul>\n<li>Free Code Camp</li>\n<li>Challenge</li>\n<li>Algorithm</li>\n<li>Front End Project</li>\n<li>Back End Project</li>\n<li>Top menu buttons.</li>\n<li>Camper</li>\n<li>Full Stack</li>\n<li>Bug</li>\n</ul>\n<h2>CS terminology</h2>\n<h3>Untranslated</h3>\n<ul>\n<li>Hardware</li>\n<li>Software</li>\n<li>Bit</li>\n<li>Byte</li>\n<li>Front-end</li>\n<li>Link</li>\n<li>Framework</li>\n<li>Query</li>\n</ul>\n<h3>Translated</h3>\n<ul>\n<li>Boolean Logic: Lógica Booleana</li>\n<li>Loop: Búcle</li>\n<li>Computer Science: Informática</li>\n<li>Run (a program): Ejecutar</li>\n<li>Click: Darle click</li>\n<li>Responsive: Adaptable</li>\n</ul>\n<h2>General terminology</h2>\n<h3>Translated</h3>\n<ul>\n<li>Non-profit: Empresas sin fines de lucro</li>\n<li>Self-paced: Manejados a tu propio ritmo</li>\n</ul>\n<h2>HTML / CSS terminology</h2>\n<h3>Non-Traslated</h3>\n<ul>\n<li>Web</li>\n<li>Tests &#x26; challengeSeeds (they shouldn\'t be translated, at least for this first version).</li>\n</ul>\n<h4>To do</h4>\n<p>Video para mostrar a otras personas como colaborar con la traducción y revisión de los archivos.</p>\n<h4>To discuss</h4>\n<p>Género a usar? ejem: "Una de las mejores maneras de mantenerte <strong>motivado</strong> cuando estás aprendiendo..."</p>\n<ul>\n<li>"motivado o motivada" (ambos?)</li>\n</ul>',frontmatter:{title:"Spanish Terminology Alignment",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/spanish-terminology-alignment/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/spanish-terminology-alignment/"}}}});
